import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonCheckbox, IonLabel, IonNote, IonBadge, IonFab, IonFabButton, IonIcon, IonSearchbar, IonThumbnail } from '@ionic/react';
import React from 'react';
import { RouteComponentProps } from 'react-router';
import { add } from 'ionicons/icons';
import HackBeanpot from '../images/hbp-logo.png';

const Home: React.FC <RouteComponentProps> = (props) =>  {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Upcoming Events</IonTitle>
        </IonToolbar>
        <IonToolbar>
        <IonSearchbar></IonSearchbar>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
      {/* <IonSearchbar showCancelButton="focus"></IonSearchbar> */}

        <IonList>
          <IonItem onClick={() => props.history.push('/event')}> 
            <IonThumbnail>
              <img src={HackBeanpot}/>
            </IonThumbnail>
            <IonLabel>
              <h2>HackBeanpot</h2>
              <p>An independently-run Boston hackathon for curious students, hackers, makers, and beginners.</p>
            </IonLabel>
          </IonItem>
          <IonItem onClick={() => props.history.push('/event')}> Community Jam </IonItem>
          <IonItem onClick={() => props.history.push('/event')}> TechTogether </IonItem>
        </IonList>


        <IonFab vertical="bottom" horizontal="end" slot="fixed">
          <IonFabButton onClick={() => props.history.push('/create-event')}>
          <IonIcon icon={add} />
          </IonFabButton>
        </IonFab>

      </IonContent>
    </IonPage>
  );
};


export default Home;
